      'Die geldende databeskermingsreg verleen jou teenoor die verantwoordelike omvattende betrokke regte (inligtings- en intervensieregte) ten opsigte van die verwerking van jou persoonlike data, waaroor ons jou hieronder inlig:\n\n- Inligtingsreg volgens Art. 15 AVG: Jy het veral \'n reg op inligting oor jou persoonlike data wat deur ons verwerk word, die verwerkingsdoeleindes, die kategorieë van verwerkte persoonlike data, die ontvangers of kategorieë van ontvangers, teenoor wie jou data bekend gemaak is of word, die beplande stoorduur of die kriteria vir die bepaling van die stoorduur, die bestaan van \'n reg op regstelling, uitwissing, beperking van die verwerking, beswaar teen die verwerking, klagte by \'n toesighoudende owerheid, die oorsprong van jou data, as hierdie nie deur ons by jou versamel is nie, die bestaan van \'n outomatiese besluitneming insluitend profilering en moontlik betekenisvolle inligting oor die betrokke logika en die jou betreffende omvang en die beoogde gevolge van so \'n verwerking, sowel as jou reg op onderrig, watter waarborge volgens Art. 46 AVG by oordrag van jou data na derdelande bestaan;\n\n- Reg op regstelling volgens Art. 16 AVG: Jy het \'n reg op onmiddellike regstelling van jou betreffende onjuiste data en/of voltooiing van jou by ons gestoorde onvolledige data;\n\n- Reg op uitwissing volgens Art. 17 AVG: Jy het die reg om die uitwissing van jou persoonlike data te eis wanneer die voorwaardes van Art. 17 Abs. 1 AVG bestaan. Hierdie reg bestaan egter veral nie wanneer die verwerking nodig is vir die uitoefening van die reg op vrye meningsuiting en inligting, vir die vervulling van \'n wetlike verpligting, om redes van openbare belang of vir die geltendmaking, uitoefening of verdediging van regsaansprake nie;\n\n- Reg op beperking van die verwerking volgens Art. 18 AVG: Jy het die reg om die beperking van die verwerking van jou persoonlike data te eis, solank die deur jou betwiste korrektheid van jou data nagegaan word, as jy \'n uitwissing van jou data weens ontoelaatbare dataverwerking weier en in plaas daarvan die beperking van die verwerking van jou data eis, as jy jou data vir die geltendmaking, uitoefening of verdediging van regsaansprake benodig, nadat ons hierdie data na doelbereiking nie meer benodig nie of as jy beswaar om redes van jou besondere situasie gemaak het, solank nog nie vasgestel is of ons geregtigde redes oorheers nie;\n\n- Reg op onderrig volgens Art. 19 AVG: Het jy die reg op regstelling, uitwissing of beperking van die verwerking teenoor die verantwoordelike geltend gemaak, is hierdie verplig om alle ontvangers, aan wie die jou betreffende persoonlike data bekend gemaak is, hierdie regstelling of uitwissing van die data of beperking van die verwerking mee te deel, tensy dit onmoontlik blyk te wees of met \'n buitensporige moeite verbonde is. Jy het die reg om oor hierdie ontvangers ingelig te word.\n\n- Reg op dataoordraagbaarheid volgens Art. 20 AVG: Jy het die reg om jou persoonlike data, wat jy aan ons verskaf het, in \'n gestruktureerde, algemene en masjienleesbare formaat te ontvang of die oordrag na \'n ander verantwoordelike te eis, voor sover dit tegnies moontlik is;\n\n- Reg op herroeping van verleende toestemmings volgens Art. 7 Abs. 3 AVG: Jy het die reg om \'n eenmaal verleende toestemming in die verwerking van data te enige tyd met effek vir die toekoms te herroep. In die geval van herroeping sal ons die betrokke data onmiddellik uitvee, voor sover \'n verdere verwerking nie op \'n regsgrondslag vir toestemminglose verwerking gesteun kan word nie. Deur die herroeping van die toestemming word die wettigheid van die verwerking wat op grond van die toestemming tot die herroeping plaasgevind het nie geraak nie;\n\n- Reg op klagte volgens Art. 77 AVG: As jy van mening is dat die verwerking van die jou betreffende persoonlike data teen die AVG oortree, het jy – sonder nadeel van \'n ander administratiewe of geregtelike regsmiddel – die reg op klagte by \'